import React, { useState } from 'react';
import { useNavigate } from 'react-router-dom';
import './styles.css';

function Login() {
  const navigate = useNavigate();
  const [lang, setLang] = useState('en');

  const labels = {
    en: ["Login", "User Login", "New user? Register here"],
    fr: ["Connexion", "Connexion Utilisateur", "Nouvel utilisateur ? Inscrivez-vous ici"],
    es: ["Iniciar sesión", "Inicio de sesión de usuario", "¿Nuevo usuario? Regístrate aquí"],
    hi: ["लॉग इन करें", "यूज़र लॉगिन", "नया उपयोगकर्ता? यहाँ पंजीकरण करें"],
    te: ["లాగిన్", "వినియోగదారు లాగిన్", "కొత్త వినియోగదారు? ఇక్కడ నమోదు చేయండి"]
  };

  const handleSubmit = (e) => {
    e.preventDefault();
    alert("Login successful (simulated)");
    navigate("/vastu");
  };

  return (
    <div className="hero">
      <h1>{labels[lang][1]}</h1>
      <label>Language:
        <select onChange={(e) => setLang(e.target.value)} value={lang}>
          {Object.keys(labels).map(l => <option key={l} value={l}>{l}</option>)}
        </select>
      </label>
      <form onSubmit={handleSubmit}>
        <input type="text" placeholder="Username or Email" required /><br /><br />
        <input type="password" placeholder="Password" required /><br /><br />
        <button type="submit">{labels[lang][0]}</button>
      </form>
      <a href="/register">{labels[lang][2]}</a>
    </div>
  );
}
export default Login;
